import React from "react";
import { Route, Redirect } from "react-router-dom";

const ProtectedRout = ({ component: Component }, { ...props }) => {
  return (
    <Route>
      {() =>
        props.loggedIn ? <Component {...props} /> : <Redirect to="./login" />
      }
    </Route>
  );
};

export default ProtectedRout;
